  activateTab() {
    if (this.router.url.includes('overview')) {
      this.tabValue = 1;
    }
    if (this.router.url.includes('account')) {
      this.tabValue = 2;
    }
    if (this.router.url.includes('plan')) {
      this.tabValue = 3;
    }
    if (this.router.url.includes('activity')) {
      this.tabValue = 4;
    }
    if (this.router.url.includes('transact')) {
      this.tabValue = 5;
    }
  }

  getClientData(data) {
    const obj = {
      clientId: data.clientId
    };
    this.peopleService.getClientOrLeadData(obj).subscribe(
      data => {
        console.log('ClientBasicDetailsComponent getClientOrLeadData data: ', data);
        if (data == undefined) {
          return;
        } else {
          this.authService.setClientData(data);
        }
      },
      err => {
        console.error(err);
      }
    );
  }

  openChangePassword(value, data) {

    const fragmentData = {
      flag: value,
      data,
      id: 1,
      state: 'open50',
      componentName: ChangeClientPasswordComponent,

    };
    const rightSideDataSub = this.subinject.changeNewRightSliderState(fragmentData).subscribe(
      sideBarData => {
        console.log('this is sidebardata in subs subs : ', sideBarData);
        if (UtilService.isDialogClose(sideBarData)) {
          if (UtilService.isRefreshRequired(sideBarData)) {

          }
          rightSideDataSub.unsubscribe();
        }

      }
    );
  }

  goToValidOverviewUrl() {
    let url;
    if (this.roleService.overviewPermission.subModules.myFeed.enabled) {
      url = '/customer/detail/overview/myfeed'
      this.router.navigate([url])
      return
    }
    if (this.roleService.overviewPermission.subModules.profile.enabled) {
      url = '/customer/detail/overview/profile'
      this.router.navigate([url])
      return
    }
    if (this.roleService.overviewPermission.subModules.documents.enabled) {
      url = '/customer/detail/overview/documents'
      this.router.navigate([url])
      return
    }
  }

  goToPlanValidUrl() {
    let url;
    if (this.roleService.planPermission.subModule.profile.enabled) {
      url = 'customer/detail/plan/profile'
      this.router.navigate([url])
      return
    }
    if (this.roleService.planPermission.subModule.goals.enabled) {
      url = 'customer/detail/plan/goals'
      this.router.navigate([url])
      return
    }
  }

  goToPortfolioValidUrl() {
    let url;
    if (this.roleService.portfolioPermission.subModule.portfolioDashboard.enabled) {
      url = '/customer/detail/account/summary'
      this.router.navigate([url])
      return
    }
    if (this.roleService.portfolioPermission.subModule.liabilities.enabled) {
      url = '/customer/detail/account/liabilities'
      this.router.navigate([url])
      return
    }
    if (this.roleService.portfolioPermission.subModule.insurance.enabled) {
      url = '/customer/detail/account/insurance'
      this.router.navigate([url])
      return
    }
  }

  goToValidTransactionUrl() {
    let url;
    if (this.roleService.transactionPermission.subModule.transactionsModule.enabled) {
      url = '/customer/detail/transact/list'
      this.router.navigate([url])
      return
    }
    if (this.roleService.transactionPermission.subModule.investorsModule.enabled) {
      url = '/customer/detail/transact/investors'
      this.router.navigate([url])
      return
    }
    if (this.roleService.transactionPermission.subModule.mandateModule.enabled) {
      url = '/customer/detail/transact/mandate'
      this.router.navigate([url])
      return
    }
  }

  logout() {
    this.enumDataService.setSearchData([]);
    // if (!this.authService.isAdvisor()) {
    this.customerOverview.clearServiceData();
    this.domainData = AuthService.getDomainDetails();
    this.authService.logout();
    if (this.domainData) {
      let mainDomain;
      let clientSubDomain = this.domainData.hostName;
      mainDomain = `https://www${clientSubDomain.substring(clientSubDomain.indexOf('.'), clientSubDomain.length)}`
      window.open(mainDomain, "_self")
    } else {
      this.router.navigate(['/login'])
    }
    this.MfServiceService.clearStorage();
    // }
  }

  goHome() {
    AuthService.goHome(this.router);
  }
